import {View, Text, StyleSheet, FlatList} from 'react-native';
import LoginScreen1 from './Screens/LoginScreen/LoginScreen1';
import RegisterScreen1 from './Screens/RegisterScreen/RegisterScreen1';


const App = () => {
  return(
    // <LoginScreen1 />

    <RegisterScreen1 
    imgSrc={require('./assets/email_icon.png')} 
    headingText1 = "What's your email?" 
    headingText2 = "We'll check if you have an account"
    inputLabel = "Email"
    inputPlaceholder = "email@address.com jjjj"
    />
  )
}

export default App;
